] This is the reason why Harappan language is not directly attested, and its affiliation uncertain.[50] A relationship or membership of the Dravidian or Elamo-Dravidian language family is proposed by some scholars.[51][52]   Three stamp seals and their impressions bearing Indus script characters alongside animals: ""unicorn"" (left), bull (center), and elephant (right); Guimet Museum After the collapse of Indus Valley civilisation, the inhabitants of the Indus Valley civilisation migrated from the river valleys of Indus and Ghaggar-Hakra, towards the Himalayan foothills of Ganga-Yamuna basin.[53]',	'2023-05-03 12:49:18.54+00'),
