('1aceb75f-2d56-41a1-be4c-5267fbba6e0e',	'0dd86f93-cc23-4b0e-8d3e-abd63ea7d968',	'60ab7678-d67d-40a6-91c2-31947df6b304',	'f',	'f11aaed5-1de5-4532-9291-70cdbc72ac3c',	'2023-02-15 14:20:52.779871+00',	'2023-05-04 14:23:50.051+00',	NULL,	'0319e617-13fc-404a-a017-236d94a8bbe3',	'19d2610f-536b-4d31-9822-7127d05ae704',	'Devices have been used to aid computation for thousands of years, probably initially in the form of a tally stick.[9] The Antikythera mechanism, dating from about the beginning of the first century BC, is generally considered to be the earliest known mechanical analog computer, and the earliest known geared mechanism.[10] Comparable geared devices did not emerge in Europe until the 16th century, and it was not until 1645 that the first mechanical calculator capable of performing the four basic arithmetical operations was developed.[11]  Electronic computers, using either relays or valves, began to appear in the early 1940s. The electromechanical Zuse Z3, completed in 1941, was the world''s first programmable computer, and by modern standards one of the first machines that could be considered a complete computing machine. During the Second World War, Colossus developed the first electronic digital computer to decrypt German messages. Although it was programmable, it was not general-purpose, being designed to perform only a single task. It also lacked the ability to store its program in memory; programming was carried out using plugs and switches to alter the internal wiring.[12] The first recognizably modern electronic digital stored-program computer was the Manchester Baby, which ran its first program on 21 June 1948.',	't',	'1946830',	'07-31-2023',	'',	'Perpetual',	'',	'$',	'2023-06-01 14:23:50.051+00',	'014c4f85-0866-4954-a2d0-a3786be7f432',	'f15b2069-57d9-4807-9054-e0a123878061',	'b5fbd506-e057-45b3-8785-78482d763cae',	'https://app1.hirisetech.com/api/salesContract/1683210229743.csv',	NULL,	NULL,	'228867.90000000002',	'228867.90000000002',	NULL,	NULL,	NULL,	NULL,	'2023-05-04 14:20:52.783+00',	't',	'The development of transistors in the late 1940s at Bell Laboratories allowed a new generation of computers to be designed with greatly reduced power consumption. The first commercially available stored-program computer, the Ferranti Mark I, contained 4050 valves and had a power consumption of 25 kilowatts. By comparison, the first transistorized computer developed at the University of Manchester and operational by November 1953, consumed only 150 watts in its final version.[14]  Several other breakthroughs in semiconductor technology include the integrated circuit (IC) invented by Jack Kilby at Texas Instruments and Robert Noyce at Fairchild Semiconductor in 1959, the metal–oxide–semiconductor field-effect transistor (MOSFET) invented by Mohamed Atalla and Dawon Kahng at Bell Laboratories in 1959, and the microprocessor invented by Ted Hoff, Federico Faggin, Masatoshi Shima, and Stanley Mazor at Intel in 1971. These important inventions led to the development of the personal computer (PC) in the 1970s, and the emergence of information and communications technology (ICT).',	'2023-05-04 14:23:35.177+00'),
